import React from 'react';
import axios from 'axios';
const API = axios.create({ baseURL: process.env.REACT_APP_API || 'http://localhost:4000/api' });
export default function AdminDashboard(){ const next = async ()=>{ const res = await API.post('/queue/admin/next',{serviceType:'bank'}); alert('Next: ' + JSON.stringify(res.data.next || res.data.message)); };
  return (<div><h2>Admin Dashboard</h2><button onClick={next}>Call Next</button></div>); }
